// Given an integer array nums, return an array answer such that answer[i] is equal to the product of all the elements of nums except nums[i].

// The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.

// You must write an algorithm that runs in O(n) time and without using the division operation.



// Example 1:

// $nums = [1,2,3,4];
// Output: [24,12,8,6]
// Example 2:

$nums = [-1,1,0,-3,3];
// Output: [0,0,9,0,0]


// Constraints:

// 2 <= nums.length <= 105
// -30 <= nums[i] <= 30
// The product of any prefix or suffix of nums is guaranteed to fit in a 32-bit integer.
class Solution
{

  /**
   * @param int[] $nums
   * @return int[]
   */
    public function productExceptSelf($nums)
    {
        $num_count = count($nums);

        $prefix = [];
        for ($i=0; $i < $num_count; $i++) {
            if ($i === 0) {
                $prefix[] = $nums[$i];
            } else {
                $prefix[] = $prefix[$i - 1] * $nums[$i];
            }
        }


        $postfix = [];

        for ($x=$num_count -1; $x >= 0; $x--) {
            if ($x === $num_count -1) {
                $postfix[$x] = $nums[$x];
            } else {
                $postfix[$x] = $postfix[$x + 1] * $nums[$x];
            }
        }

        $ans = [];
        foreach ($prefix as $k => $value) {
            $pre = isset($prefix[$k - 1]) ? $prefix[$k - 1] : 1;
            $post = isset($postfix[$k + 1]) ? $postfix[$k + 1] : 1;
            $ans[] = $pre * $post;
        }
        return $ans;
    }
}
